import Vue from 'vue'
import Vuex from 'vuex'

Vue.use(Vuex)

const actions ={
    user:{
        name:'',
        passWord:''
    }
}

const mutations={}

const state={}

const store = new Vuex.Store({
    actions,
    mutations,
    state
})


export default store
